import {useState} from "react";
import Modal from "./modal";
import EducationLevelForm from '../ProfileBuilder/ResumeBuilder/educationLevel';

export default (props) => {
    const [showModal, setShowModal] = useState(false);
    const editEducationLevel = (event) => {
        event.preventDefault();
        setShowModal(!showModal);
    };
    const saveEducationLevel = (event) => {
        event.preventDefault();
        setShowModal(!showModal);
        props.saveContinue('resumeBuilder');
    };
    return (
        <div className="col-md-12 col-xl-12">
            <div className="card">
                {
                    showModal && <Modal saveFunction={saveEducationLevel} showHide={editEducationLevel} label={"Level Of Education"}>
                        <EducationLevelForm />
                    </Modal>
                }
                <div className="col-lg-12 col-md-12">
                    <div className="row">
                        <div className="card-header">
                            <div className="col-lg-4 col-md-4">
                                <b><h3>Level Of Education</h3></b>
                            </div>
                            <div className="col-lg-2 col-md-2">
                                <a id="EditLevelEducation" href="#" onClick={editEducationLevel}>
                                    <i className="fe fe-edit" title="Edit Other Education"></i>
                                </a>
                            </div>
                        </div>
                    </div>
                </div>
                <div className="card-body">
                    <div className="form-group">
                        <div className="col-lg-4 col-md-4">
                            <label htmlFor="exampleInputname1">{props.masterEducationLevel.find(edu => edu.id === props.educationLevel).name}</label>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
}
